import React from "react";
import "./ProjectImgLeft.scss";

export default (props) => (
  <div className="row no-gutters">
    <div className="col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6 order-1 order-sm-1 order-md-1 order-lg-1 order-xl-1">
      <img className="imgLeft" src={props.imgLink} alt="img not found"></img>
    </div>
    <div className="nopadding col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6 order-2 order-sm-2 order-md-2 order-lg-2 order-xl-2">
        <div className="font2 titleLeft">
          {props.title}
        </div>
    </div>
  </div>
);
